var divHooks=[],apiDocsURI=[],osaAddonsObserver=new MutationObserver(function(a){for(a=0;a<divHooks.length;a++)$(divHooks[a].selector).length&&divHooks[a].callback()});function addonAddGUIHook(a,b){divHooks.push({selector:a,callback:b})}function addonAddDocURI(a,b){apiDocsURI.push({addon:a,uri:b});apiDocsURI.sort()}
$(document).ready(function(){osaAddonsObserver.observe(document.getElementById("content"),{childList:!0});$("#content").html($("#content").html());apiDocListHtml=$("#apiDocList").html();apiDocsURI.forEach(function(a){apiDocListHtml=apiDocListHtml+'<li><a id="apiDocMenu'+a.addon+'" href="#"  onclick="loadDoc(\'addons/'+a.addon+"/"+a.uri+"')\">"+a.addon+"</a></li>"});$("#apiDocList").html(apiDocListHtml)});
